"Хабар күйінің тарихында мәселеге қатысты тікелей және жанама әрекеттер немесе қателер көрсетіледі:

 • осы мәселеге себеп болған оқиғалар реті;
 • оқиғалар хронологиясы және оқиғалар арасындағы уақыт;
 • оқиғалар тарихы, мысалы, жіберілмеген немесе жеткізілмеген хабар;
 • мәселе пайда болғанға дейін немесе одан кейін жіберілген немесе қабылданған хабарға не болғаны туралы ақпарат;
 • қабылданған хабар мазмұны мен алушы көрген мазмұн арасындағы қандай да бір өзгеріс;
 • Wi-Fi, мобильдік интернет және басқа да байланыс түрлеріндегі үзілістер;
 • мәселе пайда болған хабардың басқа хабарларға немесе бүкіл әңгімеге тигізген әсері."

"Өзгертілмеген телефон нөміріңіз хабарларды жіберу және қабылдауға қатысты белгілі бір мәселелерді көрсетуі мүмкін, мысалы:

 • телефон нөмірі префиксінің немесе жергілікті және халықаралық телефон нөмірлері форматының байқаусызда өзгертілуі;
 • телефон нөміріңізге қатысты кез келген мәселелер;
 • Rich Communication Services (RCS) протоколына қатысты Wi-Fi, мобильдік интернет және басқа да байланыс түрлеріндегі мәселелер.

Телефон нөміріңіз ақауларды жою және мәселелерді шешу үшін ғана пайдаланылады. Google компаниясы сізге немесе телефон нөміріңізбен байланысты адамдарға хабарласпайды."

"Жіберушіні растамаудың ықтимал себептері:

 • %1$s компаниясы Google-дан хабарды растауды сұрамады;
 • Google хабарды техникалық қателерге байланысты растай алмады;
 • Әлдекім %1$s компаниясының атын жамылуға әрекет жасады.

Бұл хабардың мазмұнынан абай болуыңыз қажет."
